public class InnerServiceSourceConfigurationFactory(Action<Humidifier.AppRunner.ServiceTypes.SourceConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.AppRunner.ServiceTypes.SourceConfiguration>
{

    internal InnerServiceAuthenticationConfigurationFactory AuthenticationConfigurationFactory { get; set; }

    internal InnerServiceCodeRepositoryFactory CodeRepositoryFactory { get; set; }

    internal InnerServiceImageRepositoryFactory ImageRepositoryFactory { get; set; }

    protected override Humidifier.AppRunner.ServiceTypes.SourceConfiguration Create()
    {
        var sourceConfigurationResult = CreateSourceConfiguration();
        factoryAction?.Invoke(sourceConfigurationResult);

        return sourceConfigurationResult;
    }

    private Humidifier.AppRunner.ServiceTypes.SourceConfiguration CreateSourceConfiguration()
    {
        var sourceConfigurationResult = new Humidifier.AppRunner.ServiceTypes.SourceConfiguration();

        return sourceConfigurationResult;
    }
    public override void CreateChildren(Humidifier.AppRunner.ServiceTypes.SourceConfiguration result)
    {
        base.CreateChildren(result);

        result.AuthenticationConfiguration ??= AuthenticationConfigurationFactory?.Build();
        result.CodeRepository ??= CodeRepositoryFactory?.Build();
        result.ImageRepository ??= ImageRepositoryFactory?.Build();
    }

} // End Of Class

